○商品名： 
　 すべりにくいスリムハンガーPOP 5color10本組 
○サイズ： 
　 1本（約）幅42cm×高さ24.5cm×厚み0.5cm 
○容量： 
　 28g 
○材質： 
　 本体/PE樹脂、ナイロン、スチール 
○生産国： 
　 中国 
○使用方法： 
　 滑りにくい特殊コーティングを施したスリムなハンガー。シルクのブラウスやキャミソール・ 
　 ドレスなどは普通のハンガーではツルツルすべって洋服ダンスの出し入れもたいへん 
　 です。そんな時、特殊コーティングを施したこのスリムハンガーが便利です。 
　 洋服を傾けても揺すってもすべりにくく、スラックスやネクタイなどもOKです。 
　 スリムで両サイドは丸みをつけて洋服の型崩れを防ぐ形状になっています。 
○使用上の注意事項： 
　 クローゼット用ですので、洗濯用ハンガーには使えません。 
※メーカーの都合によりカラーが変更になる場合があります。
